import json


class TTT:
    def __init__(self):
        self.total_hourly_model:dict = {}
        self.total_hourly_cost_model:dict = {}
        self.svk_hourly_pattern_kwh:dict = {}
        self._svkcost: float = 0
        self._yourcost: float = 0
        self.start_day = 1
        self.end_day = datetime.now().day

    def update(self):
        self.total_hourly_model = self.combine_and_sort_dictionaries( #todo: support multiple or single resultsensors
            self.convert_to_dict(nibe_hourly), 
            self.convert_to_dict(car_charge_hourly)
            )
        self.total_hourly_cost_model = self.combine_and_sort_dictionaries( #todo: support multiple or single resultsensors
            self.convert_to_dict(nibe_hourly_cost), 
            self.convert_to_dict(car_charge_cost)
            )
        hour_prices:dict[datetime, float] = self.set_hour_cost(self.total_hourly_cost_model, self.total_hourly_model)
        self.svk_hourly_pattern_kwh = self.map_consumption_to_svk_pattern(
            self.calculate_draw_percentage_hourly(consumption_profile_svk), 
            self.total_daily_consumption(self.total_hourly_model)
            )

        """map onto costs"""
        peaqcost = sum([v for k,v in self.total_hourly_cost_model.items() if k in self.svk_hourly_pattern_kwh.keys()])
        svkdata = {k: v * hour_prices.get(k,0) for k,v in self.svk_hourly_pattern_kwh.items()}
        svkcost = sum([v for k,v in svkdata.items()])
        self.svkcost = svkcost
        self.yourcost = peaqcost

        print("peaqcost", round(peaqcost,1), "kr", round(sum([v for k,v in self.total_hourly_model.items() if k in self.svk_hourly_pattern_kwh]),0),"kWh")
        print("svkcost", round(svkcost,1), "kr", round(sum([v for k,v in self.svk_hourly_pattern_kwh.items()]),0),"kWh")
        # for k,v in self.total_hourly_model.items():
        #     print(k, ";", round(v,1), ";", round(self.svk_hourly_pattern_kwh.get(k,0),2), ";", round(hour_prices.get(k,0),2))

    @property
    def svkcost(self):
        return self._svkcost

    @svkcost.setter
    def svkcost(self, value):
        self._svkcost = value

    @property
    def yourcost(self):
        return self._yourcost
    
    @yourcost.setter
    def yourcost(self, value):
        self._yourcost = value

    @staticmethod
    def convert_to_dict(json_str):
        result = {}
        for item in json_str:
            dt = datetime.strptime(item['isodate'], '%Y-%m-%d %H:%M:%S').replace(second=0, minute=0, microsecond=0)            
            dt -= timedelta(hours=1) #needed to handle input from ha-db. must be fixed elsewhere
            result[dt] = item['state']
        return result

    @staticmethod
    def combine_and_sort_dictionaries(model1, model2) -> dict:
        ret = {k: model1.get(k, 0) + model2.get(k, 0) for k in set(model1) | set(model2)}
        modelkeys = sorted(ret.keys())
        return {k: ret[k] for k in modelkeys}    

    """Create and set hour_prices from the derived data"""
    @staticmethod
    def set_hour_cost(input_cost, input_cons) -> dict:
        ret: dict = {}
        for dt, cons in input_cons.items():
            try:
                if input_cost[dt] == 0:
                    ret[dt] = 0
                else:
                    ret[dt] = round(input_cost[dt]/cons,3)
            except Exception as e:
                print("no cost for ", dt, cons, e)
        return ret

    """Calculate the daily percentage of the total draw, hourly"""
    def calculate_draw_percentage_hourly(self, input) -> dict:
        ret: dict = {}
        for d in range(self.start_day, self.end_day):
            daily_draw = sum([abs(cons) for dt, cons in input.items() if dt.day == d])
            for dt, cons in input.items():
                if dt.day == d:
                    ret[dt] = round(abs(cons)/daily_draw,3)
        return ret

    """Map the daily consumption onto the svk-pattern"""
    def total_daily_consumption(self, input) -> dict:
        ret: dict = {}
        for d in range(self.start_day, self.end_day):
            ret[d] = sum([abs(cons) for dt, cons in input.items() if dt.day == d])
        return ret

    @staticmethod
    def map_consumption_to_svk_pattern(input, daily_consumption) -> dict:
        ret: dict = {}
        for dt, perc in input.items():
            ret[dt] = round(daily_consumption[dt.day]*perc,3)
        return ret


t = TTT()
t.end_day = 28
t.update()
print(t.yourcost)
print(t.svkcost)


